import React, { Component } from 'react';

class InfoModule extends Component {

	constructor(modules){
		super();
	}

	renderModules(){
		for (const id in this.props) {
			this.renderModule(id);
		}
	}

	renderModule(id){
		switch(id){
			case 1:
				return "1";
			case 2:
				return "2";
			default:
				return "Default";
		}
	}

	render(){
		return(
		<div className="InfoModules">
			{this.renderModules()};
		</div>);
	}
}

export default InfoModule;
